const DEPARTEMENTS_ILE_DE_FRANCE = [
  "75", // Paris
  "77", // Seine-et-Marne
  "78", // Yvelines
  "91", // Essonne
  "92", // Hauts-de-Seine
  "93", // Seine-Saint-Denis
  "94", // Val-de-Marne
  "95", // Val-d'Oise
];

const ETATS_ENTREPRISE = {
  EN_ATTENTE: "en attente",
  ENTRETIEN: "entretien",
  REFUS: "refus",
};

export { DEPARTEMENTS_ILE_DE_FRANCE };
